import React from 'react'
import { Container, Col, Row } from 'react-bootstrap'
//import { HomeBackground } from './green-fields.jpg'
import './Home.css'
import Button from 'react-bootstrap/Button'
import { useHistory } from 'react-router-dom'

function HomePage() {
  let history = useHistory()

  var personInfo = localStorage.getItem('currentUser')
  var UserData = JSON.parse(personInfo)
  //console.log(UserData)

  const newPage = (path) => {
    history.push({
      pathname: '/user/' + path + UserData?.id, // userId must be here
      state: { personId: UserData?.id }, // here too
    })
  }

  const BuildingButton = () => {
    const [showResults, setShowResults] = React.useState(false)
    const onClick = () => setShowResults(true)
    return (
      <div>
        <input type='submit' value='Building' onClick={onClick} />
        {showResults ? <BuildingResults param={'building'} /> : null}
      </div>
    )
  }

  const BuildingResults = (param) => (
    <Container>
      <Button
        className='RentButton'
        variant='warning'
        onClick={(param) => {
          newPage(param + '/rent')
        }}
      >
        Rent
      </Button>

      <Button
        className='BookingButton'
        variant='warning'
        onClick={(param) => {
          newPage(param + '/selling')
        }}
      >
        Buy
      </Button>
    </Container>
  )

  const LandButton = () => {
    const [showResults, setShowResults] = React.useState(false)
    const onClick = () => setShowResults(true)
    return (
      <div>
        <input type='submit' value='Land' onClick={onClick} />
        {showResults ? <LandResults /> : null}
      </div>
    )
  }

  const LandResults = () => (
    <Container>
      <Button
        className='RentButton'
        variant='warning'
        onClick={() => {
          newPage('land/rent')
        }}
      >
        Rent
      </Button>
      <Button
        className='BookingButton'
        variant='warning'
        onClick={() => {
          newPage('land/selling')
        }}
      >
        Buy
      </Button>
    </Container>
  )

  return (
    <Container className='PageStyle'>
      <Row>
        <Col>
          <h1>LAND AND BUILDING</h1>
          <h5>Find you best offer for you with our service</h5>
        </Col>
        <Col>
          <BuildingButton />
          <LandButton />
        </Col>
      </Row>
      <Row>
        <h1> Our benefites... ... ... ... ...</h1>
      </Row>
    </Container>
  )
}

export default HomePage
